import React from "react";

const DataTable = ({ accvalues, setSelected, searchTerm }) => {
  // Filter accounts based on the search term
  const filteredAccounts = accvalues.filter((account) =>
    account.username.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="data-table-container">
      <table className="min-w-full bg-white">
        <thead>
          <tr>
            <th className="py-2 px-4">Username</th>
            <th className="py-2 px-4">Email</th>
            <th className="py-2 px-4">Role</th>
            <th className="py-2 px-4">Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredAccounts.map((account, index) => (
            <tr key={index} className="border-t">
              <td className="py-2 px-4">{account.username}</td>
              <td className="py-2 px-4">{account.email}</td>
              <td className="py-2 px-4">{account.role}</td>
              <td className="py-2 px-4">
                <button
                  onClick={() => setSelected(account)}
                  className="bg-green-500 hover:bg-green-600 text-white font-bold py-1 px-2 rounded"
                >
                  Select
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DataTable;
